func:
if (global.get("myarray") === undefined)
    global.set("myarray", new Array(4));

var varname = msg.payload.variablename;
var idx1 = varname.indexOf('[');
var idx2 = varname.indexOf(']');
var x = varname.substring(idx1 + 1, idx2);

var myarray = global.get("myarray");
myarray[x] = msg.payload.variabledata[0].y;
global.set("myarray", myarray);

var str = "";
for (var i = 0; i < myarray.length; i++)
    str += String.fromCharCode(myarray[i]);

msg.txt = str;
return msg;
